import React from 'react';
import '../components_css/inicio.css'


function Inicio() {
    const meses = ['Meses', 'Janeiro', 'Fevereiro', 'Março', 'Maio', 'Junho', 'Julho', 'Agosto', 'Setembro', 'Outubro', 'Novembro', 'Dezembro']
    const nowMonth = meses[new Date().getMonth()]
    return (
        <div>

            <div className="card border-dark shadow cardmensal" style={{ width: '18rem' }}>
                <span className="card-body">
                    <span className="font-weight-bold text-success text-uppercase mb-1 titulo">Faturamento {nowMonth} </span>
                    <span className="h5 mb-0 font-weight-bold text-gray-800 valor">R$ 40,000</span>
                    <span style={{fontSize: "2em", color: "grey"}} className="icone">
                        <i className="fas fa-calendar-day" />
                    </span>
                </span>
            </div>
        </div>
    )
}

export default Inicio;
